import React from 'react';

const ColoredLineWhite = ({ color }) => (
    <hr
        style={{
            color: "white",
            backgroundColor: color,
            height: 0.5,
            width: 800
        }}
    />
);

const ColoredLineBlack = ({ color }) => (
    <hr
        style={{
            color: color,
            backgroundColor: color,
            height: 0.5,
            width: 800
        }}
    />
);

export default ColoredLineWhite;
